// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./ERC721EnumerableUpgradeable.sol";
import "./access/Ownable.sol";

// Errors
error BusinessCardBase__NotFirstMint();
error BusinessCardBase__InvalidString();
error BusinessCardBase__InvalidETHAmountSent();
error BusinessCardBase__NotMintable();
error BusinessCardBase__NotStaked();
error BusinessCardBase__ExceededPeople();
error BusinessCardBase__InvalidArrayCount();

contract BusinessCardBase is ERC721EnumerableUpgradeable {
    enum CardType {
        Personal,
        Business
    }
    // State Variables
    Card[] private cards;
    uint32 internal constant MAX_CARDS = 1000;
    uint32 internal constant MAX_FIRST_MINT = 10;
    uint32 constant MAX_EMPLOYEES = 10;
    uint32 constant MAX_DECIMALS = 10 ^ 18;
    uint256 internal stakePrice;
    uint256 internal firstMintPrice;
    uint256 internal mintPrice;
    uint256 constant STAKE_TIME = 180 days;

    // Mappings
    mapping(address => bool) internal firstMinted;
    mapping(address => mapping(address => uint256)) internal addressToDivisionToMintable;
    mapping(address => uint256) internal stakedTime;
    mapping(address => bool) internal successfullyStaked;
    mapping(address => string) internal addressToCompanyName;

    struct Card {
        string name;
        string email;
        string phone;
        string company;
        CardType cardType;
        uint256 valueDesired;
        address owner;
    }

    // Events
    event CardCreated(
        uint256 indexed id,
        string name,
        string email,
        string phone,
        string company,
        uint256 valueDesired,
        address owner
    );
    event CardTransfer(uint256 indexed id, address indexed from, address indexed to);
    event Stake(address indexed staker, uint256 amount, string companyName);
    event PartyMint(address indexed company, address[] employeeAddresses, uint32 employeeCount);

    // Functions
    modifier isMintable() {
        if (addressToDivisionToMintable[msg.sender][msg.sender] <= 0) {
            revert BusinessCardBase__NotMintable();
        }
        _;
    }

    modifier onlyStaked() {
        if (successfullyStaked[msg.sender] == false) {
            revert BusinessCardBase__NotStaked();
        }

        _;
    }

    function __BusinessCardBase__init(uint256 _firstMintPrice, uint256 _mintPrice, uint256 _stakePrice) external {
        __ERC721_init("BusinessCardBase", "BC");
        firstMintPrice = _firstMintPrice;
        mintPrice = _mintPrice;
        stakePrice = _stakePrice;
    }

    function mint() public payable returns (bool success) {
        if (firstMinted[msg.sender]) {
            if (msg.value != mintPrice) {
                revert BusinessCardBase__InvalidETHAmountSent();
            }
            addressToDivisionToMintable[msg.sender][msg.sender] += 1;
        } else {
            if (msg.value != firstMintPrice) {
                revert BusinessCardBase__InvalidETHAmountSent();
            }
            firstMinted[msg.sender] = true;
            addressToDivisionToMintable[msg.sender][msg.sender] = MAX_FIRST_MINT;
        }

        return true;
    }

    function _mint(
        string memory _name,
        string memory _email,
        string memory _phone,
        address _company,
        uint256 valueDesired
    ) public virtual isMintable {
        if (
            bytes(_name).length * bytes(_email).length * bytes(_phone).length * valueDesired == 0 || _company == address(0)
        ) {
            revert BusinessCardBase__InvalidString();
        }
        if (addressToDivisionToMintable[msg.sender][_company] <= 0) {
            revert BusinessCardBase__NotMintable();
        }

        CardType cardType;
        string memory company = addressToCompanyName[_company];
        if (bytes(company).length == 0 || (msg.sender == _company)) {
            cardType = CardType.Personal;
        } else {
            cardType = CardType.Business;
        }

        Card memory card = Card({
            name: _name,
            email: _email,
            phone: _phone,
            company: bytes(company).length == 0 ? "N/A" : company,
            cardType: cardType,
            valueDesired: valueDesired,
            owner: msg.sender
        });

        cards.push(card);
        uint256 _id = cards.length - 1;
        addressToDivisionToMintable[msg.sender][msg.sender] -= 1;
        _safeMint(msg.sender, _id);
        if (cardType == CardType.Business) approve(_company, _id);
        emit CardCreated(_id, _name, _email, _phone, company, valueDesired, msg.sender);
    }

    function stake(string memory _company) public payable returns (bool success) {
        if (msg.value != stakePrice) {
            revert BusinessCardBase__NotStaked();
        }

        successfullyStaked[msg.sender] = true;
        addressToCompanyName[msg.sender] = _company;

        emit Stake(msg.sender, msg.value, _company);

        return true;
    }

    function partyMint(
        uint256 _employeeCount,
        address[] memory employeeAddresses
    ) external payable onlyStaked returns (bool success) {
        if (_employeeCount > MAX_EMPLOYEES) {
            revert BusinessCardBase__ExceededPeople();
        }
        if (msg.value != mintPrice * _employeeCount) {
            revert BusinessCardBase__InvalidETHAmountSent();
        }
        if (_employeeCount != employeeAddresses.length) {
            revert BusinessCardBase__InvalidArrayCount();
        }

        address companyAddress = msg.sender;
        for (uint256 i = 0; i < _employeeCount; i++) {
            addressToDivisionToMintable[employeeAddresses[i]][companyAddress] += 1;
        }

        emit PartyMint(msg.sender, employeeAddresses, uint32(_employeeCount));

        return true;
    }

    function _transfer(address _from, address _to, uint256 _tokenId) internal virtual override {
        super._transfer(_from, _to, _tokenId);
        emit CardTransfer(_tokenId, _from, _to);
    }

    function getFirstMintPrice() external view returns (uint256) {
        return firstMintPrice;
    }

    function getMintPrice() external view returns (uint256) {
        return mintPrice;
    }

    function getCards() external view returns (Card[] memory) {
        return cards;
    }

    function getCard(uint256 _id) external view returns (Card memory) {
        return cards[_id];
    }

    function getCardCount() external view returns (uint256) {
        return cards.length;
    }

    function getCardCountByOwner(address _owner) external view returns (uint256) {
        return balanceOf(_owner);
    }

    function getCardByOwner(address _owner, uint256 _index) external view returns (Card memory) {
        return cards[tokenOfOwnerByIndex(_owner, _index)];
    }

    function getCompanyName(address companyAddress) external view returns (string memory) {
        return addressToCompanyName[companyAddress];
    }
}

contracts/BusinessCardMarketplace.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./IERC721.sol";

// Errors
error BusinessCardMarketplace__OnlyOwner();
error BusinessCardMarketplace__AlreadyListed();
error BusinessCardMarketplace__NotListed();
error BusinessCardMarketplace__InvalidPrice();
error BusinessCardMarketplace__NotApproved();
error BusinessCardMarketplace__ApproveNotCleared();

contract BusinessCardMarketplace {
    // State Variables
    struct Listing {
        uint256 listId;
        uint256 price;
        address seller;
    }

    // Mappings
    mapping(address => mapping(uint256 => Listing)) internal listings;

    // Events
    event ListingListed(uint256 indexed cardId, uint256 price, address indexed seller);
    event ListingRemoved(uint256 indexed cardId, address indexed seller);
    event ListingBought(uint256 indexed cardId, address indexed buyer, address indexed seller, uint256 price);

    // Functions
    modifier onlyOwner(address _nftAddress, uint256 _cardId) {
        if (IERC721(_nftAddress).ownerOf(_cardId) != msg.sender) {
            revert BusinessCardMarketplace__OnlyOwner();
        }
        _;
    }

    modifier notListed(address _nftAddress, uint256 _cardId) {
        if (listings[_nftAddress][_cardId].seller != address(0) || listings[_nftAddress][_cardId].price != 0) {
            revert BusinessCardMarketplace__AlreadyListed();
        }
        _;
    }

    modifier Listed(address _nftAddress, uint256 _cardId) {
        if (listings[_nftAddress][_cardId].seller == address(0) || listings[_nftAddress][_cardId].price == 0) {
            revert BusinessCardMarketplace__NotListed();
        }
        _;
    }

    function createListing(
        address _nftAddress,
        uint256 _price,
        uint256 _cardId
    ) external onlyOwner(_nftAddress, _cardId) notListed(_nftAddress, _cardId) {
        if (_price <= 0) {
            revert BusinessCardMarketplace__InvalidPrice();
        }
        IERC721(_nftAddress).approve(address(this), _cardId);
        if (IERC721(_nftAddress).getApproved(_cardId) != address(this)) {
            revert BusinessCardMarketplace__NotApproved();
        }

        Listing memory listing = Listing(_cardId, _price, msg.sender);
        listings[msg.sender][_cardId] = listing;
        emit ListingListed(_cardId, _price, msg.sender);
    }

    function removeListing(
        address _nftAddress,
        uint256 _cardId
    ) external onlyOwner(_nftAddress, _cardId) Listed(_nftAddress, _cardId) {
        IERC721(_nftAddress).approve(address(0), _cardId);
        if (IERC721(_nftAddress).getApproved(_cardId) != address(0)) {
            revert BusinessCardMarketplace__ApproveNotCleared();
        }

        delete listings[msg.sender][_cardId];
        emit ListingRemoved(_cardId, msg.sender);
    }

    function buyCard(address _nftAddress, uint256 _cardId) external payable Listed(_nftAddress, _cardId) {
        Listing memory listing = listings[_nftAddress][_cardId];
        if (msg.value < listing.price) {
            revert BusinessCardMarketplace__InvalidPrice();
        }
        payable(listing.seller).transfer(msg.value);
        IERC721(_nftAddress).safeTransferFrom(listing.seller, msg.sender, _cardId);
        delete listings[_nftAddress][_cardId];
        emit ListingBought(_cardId, msg.sender, listing.seller, listing.price);
    }

    function updateListing(
        address _nftAddress,
        uint256 _cardId,
        uint256 _price
    ) external onlyOwner(_nftAddress, _cardId) Listed(_nftAddress, _cardId) {
        if (_price <= 0) {
            revert BusinessCardMarketplace__InvalidPrice();
        }
        listings[_nftAddress][_cardId].price = _price;
        emit ListingListed(_cardId, _price, msg.sender);
    }
}

